import React from 'react';
import Navbar from '../../Components/Navbar';
import './languages.css';
// import hindi from './img/hindi.png'
// import english from './img/eng1.png'
// import japanese from './img/japanese.png'
// import french from './img/french.png'
// import spanish from './img/spanish.png'
// import tamil from './img/tamil.png'


import LangCards from '../../Components/LangCards';



export default function Languages() {
  return (
    <>
    <Navbar/>

    <div>
    <h2 id='learn'>I want to track my proficiency in...</h2>
    </div>

    <div className='languages'>
      <LangCards id="hindi" source={hindi} value='Hindi'/>
      <LangCards id="english" source={english} value='English'/>
      <LangCards id="tamil" source={tamil} value= 'Tamil'/>
    </div>

    <div className='languages'>
      <LangCards id="french" source={french} value='French'/>
      <LangCards id="spanish" source={spanish} value='Spanish'/>
      <LangCards id="japanese" source={japanese} value= 'Japanese'/>
    </div>
    
    
    
    </>
  )
}
